import React from 'react';
import './Navbar.css';
import logo from '../../logo.png'
import Navlink from './Navlink/Navlink';

const Navbar = ({
    title,
    onPress,
    buttonColor,
    titleColor,
    buttonStyle,
    textStyle,
}) => {
    return (
        <div className='container Navbar'>
            <div className="row ">
                <div className="col-1 logoDiv">
                    <img src={logo} className="Nav-logo" alt="logo" />
                </div>
                <div className="col-2">
                </div>
                <div className="col-9 NavContainer">
                    <Navlink text="Home"></Navlink>
                    <Navlink text="I have a Sustainable Idea"></Navlink>
                    <Navlink text="I want to support"> </Navlink>
                    <Navlink text="Contact"></Navlink>
                </div>
            </div>
        </div>

    );
};

export default Navbar;
